return(<>

<div className="card">
<div className="item_img"><img  src="https://picsum.photos/340/300" alt="imsa" width="300px" height="340px"/></div>
<h2 className=" title">Maggie</h2>
<div className="categery">categery breakfast</div>
<div className="discription">Maggi noodles are dried noodles fused with oil, and sold with a packet of flavorings. These noodles are usually eaten after being cooked in boiling water for 3 to 5 minutes or eaten straight from the packet.</div>
</div>
</>
)
}
